import { createApi, fetchBaseQuery } from '@reduxjs/toolkit/query/react';
const baseUrl = 'http://localhost:3000/';

export const paymentApi = createApi({
createPaymemntIntent: builder.mutation({
    query: (data) => ({
    url: 'payments/intent',
    method: 'POST',
    body: data,
    }),
}),

});

export const {
    useCreatePaymentIntentMutation
  } = apiSlice;
